import './index.css'

const Body = props => {
  const {TaskDetails} = props
  const {dueOn, status, title, UserId} = TaskDetails
  console.log(status)
  const functionWithSwitch = () => {
    switch (status) {
      case 'pending':
        return '+'
      case 'negative':
        return '-'
      default:
        return 'neutral'
    }
  }

  // const ne = {status} === 'pending' ? <p>vamsi</p> : <p>ram</p>
  return (
    <tr>
      <td>{title}</td>
      <td>{dueOn}</td>
      <td>{functionWithSwitch}</td>
      <td>{UserId}</td>
    </tr>
  )
}
export default Body
